{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/brianyuen1997/case-study-cyclistic?scriptVersionId=134297681\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"4eade2d9","metadata":{"papermill":{"duration":0.003917,"end_time":"2023-06-20T21:55:08.591909","exception":false,"start_time":"2023-06-20T21:55:08.587992","status":"completed"},"tags":[]},"source":["# Cyclistic\n","\n","Thank you for taking your time and read my interputation of the data given for Cyclistic, any suggestions are welcomed\n","\n","This is a link to the [presentation](https://1drv.ms/p/s!AnB6VqQox1sGy3dESONCqu8rqchb?e=Q6suri) for the analysis\n","\n","## Background\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","\n","## Stakeholders\n","* *Cyclistic*: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to commute to work each day.\n","\n","* _Lily Moreno_: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","\n","* _Cyclistic marketing analytics team_: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals — as well as how you, as a junior data analyst, can help Cyclistic achieve them.\n","\n","* _Cyclistic executive team_: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.\n","\n","## Objective\n","The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, your team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, your team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n","\n","Answer the following questions\n","* How do annual members and casual riders use Cyclistic bikes differently? \n","* Why would casual riders buy Cyclistic annual memberships? \n","* How can Cyclistic use digital media to influence casual riders to become members?\n","\n","## Ask\n","What is the difference between causal and member\n","\n","* Single ride $1+0.17/min\n","\n","* Day Pass: $16.50/day (unlimited 3 hrs ride)\n","\n","* Annual Membership: $11/mo (Unlimited 45 min ride)\n","\n","What is the best time to do promotion "]},{"cell_type":"code","execution_count":1,"id":"8e7b252e","metadata":{"execution":{"iopub.execute_input":"2023-06-20T21:55:08.601434Z","iopub.status.busy":"2023-06-20T21:55:08.599629Z","iopub.status.idle":"2023-06-20T21:55:09.496428Z","shell.execute_reply":"2023-06-20T21:55:09.495084Z"},"papermill":{"duration":0.903534,"end_time":"2023-06-20T21:55:09.498392","exception":false,"start_time":"2023-06-20T21:55:08.594858","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.2     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.2     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n"]}],"source":["library(tidyverse)\n","library(patchwork)"]},{"cell_type":"markdown","id":"5efb8fda","metadata":{"papermill":{"duration":0.003107,"end_time":"2023-06-20T21:55:09.50496","exception":false,"start_time":"2023-06-20T21:55:09.501853","status":"completed"},"tags":[]},"source":["## Prepare\n","data source: \n","* bike data: divvy\n","* Tourism data: choosechicago.com\n","* weather data: visualcrossing.com\n","Remove any identifiable fields\n","\n","## Process\n","Transform data to singular format to merge\n","\n","Make sure the is no inputs prior to May 2022 or after April 2023\n","\n","## Analyse\n","Use pivot table to show ridership based on overall/month/day of week\n","\n","Use pivot table to show average temperature \n","* Calculate the mean of ride_length \n","* Calculate the max ride_length \n","* Calculate the mode of day_of_week "]},{"cell_type":"code","execution_count":2,"id":"80bd0acb","metadata":{"execution":{"iopub.execute_input":"2023-06-20T21:55:09.533793Z","iopub.status.busy":"2023-06-20T21:55:09.512348Z","iopub.status.idle":"2023-06-20T21:55:09.62738Z","shell.execute_reply":"2023-06-20T21:55:09.625992Z"},"papermill":{"duration":0.121642,"end_time":"2023-06-20T21:55:09.62967","exception":false,"start_time":"2023-06-20T21:55:09.508028","status":"completed"},"tags":[]},"outputs":[],"source":["#load data\n","total_ride <- read.csv(\"/kaggle/input/cyclistic/total ride.csv\")\n","\n","# load data to r\n","Total_Ride_wk <- read.csv(\"/kaggle/input/cyclistic/Total Ride wk.csv\")\n","# load data\n","Total_Ride_mo <- read.csv(\"/kaggle/input/cyclistic/Total Ride mo.csv\")\n","Chicago_average_weather <- read.csv(\"/kaggle/input/cyclistic/Chicago average weather.csv\")\n","# load data\n","Avg_Ride_length_wk <- read.csv(\"/kaggle/input/cyclistic/avg ride length wk.csv\")\n","Avg_Ride_length_wk_long <- tidyr::pivot_longer(Avg_Ride_length_wk, cols = c(casual, member), names_to = \"Type\", values_to = \"Count\")\n","# load data\n","Avg_Ride_length_mo <- read.csv(\"/kaggle/input/cyclistic/avg ride length per mo.csv\")\n","Avg_Ride_length_mo_long <- tidyr::pivot_longer(Avg_Ride_length_mo, cols = c(casual, member,Grand.Total), names_to = \"Type\", values_to = \"Count\")"]},{"cell_type":"markdown","id":"1a9f5b05","metadata":{"papermill":{"duration":0.002926,"end_time":"2023-06-20T21:55:09.635691","exception":false,"start_time":"2023-06-20T21:55:09.632765","status":"completed"},"tags":[]},"source":["## Share\n","### Brief intro into number of casual vs member users "]},{"cell_type":"code","execution_count":3,"id":"68785b43","metadata":{"execution":{"iopub.execute_input":"2023-06-20T21:55:09.643759Z","iopub.status.busy":"2023-06-20T21:55:09.642716Z","iopub.status.idle":"2023-06-20T21:55:10.134178Z","shell.execute_reply":"2023-06-20T21:55:10.132304Z"},