), names_to = \"Type\", values_to = \"Count\")\n","\n","# Value used to transform the data\n","coeff <- 0.0002\n","\n","#Plot data\n","ggplot() +\n","# Plot side-by-side barchart\n","  geom_bar(data=Total_Ride_mo_long, aes(x = X, y = Count, fill = Type), position = \"dodge\", stat = \"identity\") +\n","#Plot a line chart for average temperture in Chicago\n","  geom_point(data=Chicago_average_weather,aes(x=month, y=temp_f / coeff, group=1))+\n","  geom_line(data=Chicago_average_weather,aes(x=month, y=temp_f / coeff, group=1))+\n","#Adding labels\n","   labs(title = \"Count of Casual vs. Member by Month\", caption = \"Data from divvy, visualcrossing\",\n","       x = \"Month\", y = \"User Count\") +\n","#Making sure x axis is sort of month and turn label in 90%\n","  scale_x_discrete(limits = c(\"May 2022\", \"Jun 2022\", \"Jul 2022\", \"Aug 2022\", \"Sep 2022\", \"Oct 2022\", \"Nov 2022\", \"Dec 2022\", \"Jan 2023\", \"Feb 2023\", \"Mar 2023\", \"Apr 2023\"),guide = guide_axis(angle = 90)) +\n","# Add a second axis and label it\n","  scale_y_continuous(\n","    sec.axis = sec_axis( trans=~.*coeff, name=\"Average Tempture (°F)\"),labels = scales::comma) +\n","  theme_minimal() +\n","  theme(legend.position=\"bottom\")"]},{"cell_type":"markdown","id":"487e86fb","metadata":{"papermill":{"duration":0.004762,"end_time":"2023-06-20T21:55:10.804751","exception":false,"start_time":"2023-06-20T21:55:10.799989","status":"completed"},"tags":[]},"source":["* Total ridership and temperature has a positive correlation \n","* casual member uses the service less proportionally during the winter months\n","* Tourists may not be using bick service as temp gets cold\n","* The most effective way is to advertise in summer time\n","* Can boost overall winter usage by improving infrastructure for winter biking and promote shorter travel time (if applicale)\n","\n","### Average Riding Time per Day of Week"]},{"cell_type":"code","execution_count":6,"id":"b28c261d","metadata":{"execution":{"i