r by Month\", caption = \"Data from divvy\",\n","       x = \"Month\", y = \"User Count\") +\n","#Making sure x axis is sort of month and turn label in 90%\n","  scale_x_discrete(limits = c(\"May 2022\", \"Jun 2022\", \"Jul 2022\", \"Aug 2022\", \"Sep 2022\", \"Oct 2022\", \"Nov 2022\", \"Dec 2022\", \"Jan 2023\", \"Feb 2023\", \"Mar 2023\", \"Apr 2023\"),guide = guide_axis(angle = 90)) +\n","# Add a second axis and label it\n","  scale_fill_discrete(labels=c('Casual', 'Combined Average', 'Member'))+\n","  theme_minimal() +\n","  theme(legend.position=\"bottom\")"]},{"cell_type":"markdown","id":"a47ab357","metadata":{"papermill":{"duration":0.005567,"end_time":"2023-06-20T21:55:11.395378","exception":false,"start_time":"2023-06-20T21:55:11.389811","status":"completed"},"tags":[]},"source":["* Even though number of rides is lower, the length of each ride is not as significantly different\n","* Casual users rides longer\n","\n","### Conculsion\n","\n","* How do annual members and casual riders use Cyclistic bikes differently? \n","  + Member tends to ride more (resident, works in the city)\n","  + Member rider are most likely resident or works in the city. They tend to ride more frequently, but shorter. They use it more like a mode of transportation\n","  + Causal tends to ride longer (tourist, visitor)\n","  + Causal rider are likely to be tourist or visitor of the city. The ride times are longer.\n","* Why would casual riders buy Cyclistic annual memberships? \n","  + if rider can be benefited by the service by:\n","  saving money from fuel/public transit, or has a routine need to travel around Chicago\n","  + Really like the service\n","  + can condense each ride to under 15 minutes\n","* How can Cyclistic use digital media to influence casual riders to become members?\n","  + The data cannot conclude how digital media can be used to influence riders to subscribe due to the two groups having different needs and member tier cannot satisfy causal riders habits\n","\n","\n","## Act\n","* Ways to influence more casual riders to become members \n","  + Create a free tier membership to convert casual riders to member with the option to purchase beyond just day pass (maybe week/ month pass) when people are travelling\n","  + Create a Holiday pass for frequent visitors to the city with longer usage time but with limited days\n","* How and when is the best way and time Cyclistic to promote the service using digital media\n","  + Can partner with review sites such as Yelp/ tripadvisor to promote service\n","  + Can benefit from existing relationship with Lyft by offering discount after using Lyft\n","  + Promote during low season and give special offers to incentive people to use the service\n","* Winter ridership is low\n","  + can be boosted by creating better cycling infrastructure [like what Finland did](https://www.youtube.com/watch?v=Uhx-26GfCBU)\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":5.672944,"end_time":"2023-06-20T21:55:11.521316","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-06-20T21:55:05.848372","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}